function childComponent() {
  const [count, setCount] = useState()
  console.log('Child Component re-render')

  const handleClick = () => {
    setCount(count + 1)
  }
  return (
    <div>
      <p>{count}</p>
      <button onClick={handleClick}>Add</button>
    </div>
  )
}

export default childComponent
